import React from 'react'
import Common from './Common'
import web from "../images/web2.svg";

const About = () => {
    return (
        <>
            <Common h1=" To Know Who I am "
                visit="/contact"
                img={web}
                btn="Work With Me" />
        </>
    )
}

export default About
